    false,nt"url": null,nt"notes": "St. Vincent National Wildlife refuge was
    surveyed January 11 and 12, 1979, in order to determine the current status of the
    gopher tortoise on refuge lands. St. Vincent is a coastal barrier island roughly
    triangular in shape and encompasses 5000 hectares. The island is comprised of a
    series of old dunes which form ridges lying parallel to the southern shoreline.
    Many of these ridges rise over 3 m in elevation, with some reaching nearly 6 m above
    mean sea level. The ridge tops often support a scrub oak plant community in the
    interior, which becomes more open land grassy near and along the beaches. Cabbage
    palm, oak, and magnolia hammocks occupy both ridges and lower areas. Large areas
    of pipe flatwoods are found between the ridges. Fresh water ponds and marshes often
    occupy the lowest portions of the interridge troughs. Salt marsh covers much of
    the northeastern section of the! island. The rolling topography creates the conditions
    for the variety of well interspersed and diverse plant communities.",nt"owner_org":
